import React from 'react';
import Table from '@material-ui/core/Table';
import Paper from '@material-ui/core/Paper';
import { tableStyles } from 'components/common/displayData/table/tableStyles';
import { TableHeaders } from '/common/displayData/table/tableHeaders';
import { TableBodys } from '/common/displayData/table/tableBody';

export const CollectionTable = props => {

    const classes = tableStyles();

    return (
        <Paper className={classes.root}>
            <Table className={classes.table}>
                <TableHeaders />
                <TableBodys collectionData={props.collectionData}/> 
            </Table>
        </Paper>
    );
};
